import React from 'react';
import styled from 'styled-components';

const ServicesSection = styled.section`
  padding: 60px 40px;
  background: #f7f9fb;
  text-align: center;
`;

const Title = styled.h3`
  font-size: 28px;
  color: #0a2239;
  margin-bottom: 40px;
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit,minmax(240px,1fr));
  gap: 24px;
`;

const Card = styled.div`
  background: #fff;
  padding: 24px;
  border-radius: 8px;
  box-shadow: 0 2px 6px rgba(0,0,0,0.08);
  text-align: left;
`;

const CardImage = styled.img`
  width: 100%;
  border-radius: 4px;
  margin-bottom: 16px;
`;

const CardTitle = styled.h4`
  font-size: 20px;
  color: #0a2239;
  margin-bottom: 8px;
`;

const CardText = styled.p`
  font-size: 14px;
  color: #333;
  line-height: 1.5;
`;

export default function Services() {
  return (
    <ServicesSection id="services">
      <Title>Nossos Serviços</Title>
      <Grid>
        <Card>
          <CardImage src="/images/family3.jpg" alt="Sessão de Psicoterapia" />
          <CardTitle>Psicoterapia Familiar</CardTitle>
          <CardText>
            Espaço seguro para expressão de emoções e fortalecimento de vínculos familiares
            através de técnicas modernas e apoio contínuo.
          </CardText>
        </Card>
        <Card>
          <CardTitle>Avaliação Neuropsicológica</CardTitle>
          <CardText>
            Análise detalhada das funções cognitivas para diagnóstico preciso e plano de intervenção
            personalizado para cada membro da família.
          </CardText>
        </Card>
        <Card>
          <CardTitle>Terapias Integrativas</CardTitle>
          <CardText>
            Abordagens complementares (arteterapia, mindfulness) para promover equilíbrio mental
            e emocional em todas as idades.
          </CardText>
        </Card>
      </Grid>
    </ServicesSection>
  );
}
